import { Component } from 'react'
import io from "socket.io-client"

class App extends Component {
  constructor(props: any){
    super(props)
    this.state = {
          List: ""
    }
  }

  componentDidMount() {
    this.socket = io()
  }

  render(){
    return (<div>Welcome to page!</div>)
  }
}

export default App
